import React from 'react'
import { makeStyles, Paper } from '@material-ui/core'
import { Grid } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({

    paperrow: {
        width: '195px',
        height: '85px',
        position: 'relative',
        boxShadow: 'none',
        borderRadius: '4px',
        border: '1px solid #AAAAAA',
        marginRight: '22.6px',
        marginBottom: '22.6px',
        // display: 'flex'



    },
    roomtext: {
        position: 'absolute',
        color: '#4A4A4A',
        fontSize: '22.6px',
        marginTop: "12.6px",
        fontWeight: 'bold',
        marginLeft: '26.6px'
    },
    infobutton: {
        position: 'absolute',
        width: '24px',
        height: '24px',
        marginTop: "14.5px",
        marginLeft: "1086px",
        color: "#485D84"
    },
    personicon: {
        width: '18px',
        height: '18px',
        position: 'absolute',
        top: 4,
        left: 10
    },
    typeroom: {
        fontSize: '13px',
        color: '#969696',
        fontWeight: 400,
        position: 'absolute',
        top: 50,
        marginLeft: '17.8px'

    },
    roomstatus: {
        height: '28.3px',
        width: '2.5px',
        backgroundColor: 'red',
        borderRadius: 4,
        position: 'absolute',
        marginLeft: '14.5px',
        marginTop: '15.3px'
    }




}));

export default function Roomsection() {
    const classes = useStyles()

    return (
        <Paper className={classes.paperrow}>
            <div className={classes.roomstatus}>

            </div>
            <div className={classes.roomtext}>
                101
            </div>
            <div className={classes.typeroom}>
                Standard
            </div>
        </Paper>
    )
}
